  const scriptFileEl = document.createElement("script");
  scriptFileEl.src = `https://www.googletagmanager.com/gtag/js?id=${tagId}`;
  scriptFileEl.async = true;
  document.head.append(scriptFileEl);
  const headScriptEl = document.createElement("script");
  headScriptEl.innerHTML = `
	window.dataLayer = window.dataLayer || [];
  function gtag(){dataLayer.push(arguments);}
  gtag('js', new Date());
  gtag('config', '${tagId}');`;
  document.head.append(headScriptEl);
}
function startAnalytics() {
  addGtagAnalytics();
}
